import styles from "./Sidebar.module.css"; // ⬅️ без ../../
import profileIcon from "../../Images/profile.png";
import { useNavigate } from "react-router-dom";

export default function Profile() {
  const navigate = useNavigate();

  return (
    <div className={styles.profile} onClick={() => navigate("/profile")}>
      <img src={profileIcon} alt="Profile" className={styles.profileImage} />
      <button className={styles.profileButton}>Profile</button>
    </div>
  );
}
